        auxiliar = (nodo_identificador*) malloc(sizeof(nodo_identificador));
        
        
        nuevoNodo->identificador = (char *) calloc(strlen(identificador), sizeof(char));
        auxiliar->identificador = (char *) calloc(strlen(identificador), sizeof(char));
